import React, { Component } from 'react';
import './styles.scss';
import { getAllprojects } from './../../services/project';

class HomeView extends Component {
  constructor() {
    super();
    this.state = {
      isLoaded: false,
      projects: []
    };
  }

  componentDidMount = (e) => {
    getAllprojects()
      .then((result) => {
        this.setState = {
          isLoaded: true,

          projects: result
        };
      })
      .catch((error) => {
        console.log(error);
      });
  };

  render() {
    console.log(this.state);
    return (
      <div>
        <h1>This is the Home View</h1>
      </div>
    );
  }
}

export default HomeView;
